import React, {useState} from 'react'

const Test1 = () => {

    const [rows, setRows] = useState();

    const api = `http://127.0.0.1:8000`;

    fetch(api,{
        method: 'GET',
        headers: {
            'Content-Type': 'text/plain'
        }
    })
    .then((res) => res.json())
    .then((data) => setRows(data));

    return (
        <div>
            This is data {rows}
        </div>
    )}

export default Test1
